letters = ['A', 'T', 'C', 'G', '$']

def count(lastCol):
    counter = {}
    for letter in letters:
        counter[letter] = [0] * (len(lastCol) + 1)
    for i in range(len(lastCol)):
        last = lastCol[i]
        for letter in letters:
            if letter == last:
                counter[letter][i + 1] = counter[letter][i] + 1
            else:
                counter[letter][i + 1] = counter[letter][i]
    return counter

def firstOccurrence(firstCol):
    first = {}
    for letter in letters:
        first[letter] = firstCol.index(letter)
    return first

def betterBWMatching(firstOcc, lastCol, pattern, counter):
    top = 0
    bottom = len(lastCol) - 1
    while top <= bottom:
        if pattern:
            symbol = pattern[-1]
            pattern = pattern[:-1]
            last = lastCol[top : (bottom + 1)]
            if symbol in last:
                top = firstOcc[symbol] + counter[symbol][top]
                bottom = firstOcc[symbol] + counter[symbol][bottom + 1] - 1
            else:
                return 0
        else:
            return bottom - top + 1


patterns = []
f = open("patterns.txt", "r")
f1 = f.read().split()
for pattern in f1:
    patterns.append(pattern.strip('\n'))
f.close()

text = '$'
finalList = []
for pattern in patterns:
    finalList.append(betterBWMatching(firstOccurrence(sorted(text)), text, pattern, count(text)))

print(' '.join(map(str, finalList)))